import React from 'react';

class Footer extends React.Component {
    render() {

        let date = new Date();


        return(
            <div>
                <footer>
                    <p className="text-center"><small className="text-muted">Copyright &copy; {new Date().getFullYear()} Tan Siew Ling - All Rights Reserved.</small></p>
                </footer>
            </div>
        );
    }
}

export default Footer;
